package com.ddokkang.ans.conv;

public class ConvResult {
	private double x;
	private int s_conv;
	
	public ConvResult() {
		// TODO Auto-generated constructor stub
	}

	public ConvResult(double x, int s_conv) {
		super();
		this.x = x;
		this.s_conv = s_conv;
	}

	public double getX() {
		return x;
	}

	public void setX(double x) {
		this.x = x;
	}

	public int getS_conv() {
		return s_conv;
	}

	public void setS_conv(int s_conv) {
		this.s_conv = s_conv;
	}
	
	
}
